export default class Square extends Component{

    onClick(i)
    {
      if (this.props.color==="white-card")
           this.className="black-card";
      if (this.props.color==="black-card")
             this.className="white-card";
    }
    render(){
    return (
        <button className= {this.props.color}
         onClick={this.onClick()}>
        </button>
        /*<button></button>*/
    )
    }
}

